  \"2016-03-10T05:39:48.935789\",\n\t\"name\": \"corporations-search-api\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Search APInnWe offer a simple API for searching
  and retrieving corporations data which you may use in your applications and web
  sites. Results can be returned in JSON with padding (JSONP) and XML formats.  You
  do not need to apply for a special key to retrieve the information.nnGetting StartednnThe
  easiest way to retrieve results is to use our web site to search for the information
  you need, using the parameters you plan to use in your application.  On the results
  screen for both the results and the details of a corporation/entity, append the
  query string with \"format=xml\" or \"format=json\", respectively. This will give
  you an example of what will be returned. You can then use the final URL and modify
  the values as you deem necessary.nnSearchingnnA maximum of 20 results are returned
  with each query.nnURL: http://www.sos.wa.gov/corps/search_results.aspxnnQuery String
  Parameters:nn    name (required) - words or partial words to be found within a corporations
  namen    name_type - \"starts_with\", \"contains\", or \"ends_with\", specifies
  how the values for the name parameter should functionn    criteria - \"all\", \"any\",
  \"exact\" , in multi-word searches, this specifies how the words can or cannot appear
  in a corporations namen    category - category of the corporation.n        \"na\"
  - Alln        \"BNK\" - Bankn        \"COP\" - Cooperativen        \"SOL\" - Corporation
  Solen        \"CRU\" - Credit Unionn        \"FMA\" - Fish Marketing Actn        \"RFN\"
  - Foreign Registrationn        \"FBS\" - Fraternal Building Societyn        \"FRA\"
  - Fraternal Societyn        \"GRG\" - Grangen        \"INS\" - Insurancen        \"LLP\"
  - Limited Liability Partnershipn        \"PLC\" - Limited Liability Professionaln
  \       \"LLC\" - Limited Liability Regularn        \"LTD\" - Limited Partnershipn
  \       \"MAS\" - Massachusetts Trustn        \"MIL\" - Militaryn        \"MMC\"
  - Miscellaneous and Mutualn        \"PRO\" - Professional Servicen        \"PBC\"
  - Public Benefit Corporationn        \"PUB\" - Public Utilitiesn        \"REG\"
  - Regular Corporationn        \"RES\" - Reservation of Namen        \"SAL\" - Savings
  and Loann        \"CAS\" - Special Cooperativen    active - status of the corporation.
  \ \"A\" for active, \"T\" for inactive, \"NA\" for eithern    agent_name - name
  or partial name of registered agentn    city - city of registered agent's addressn
  \   zip - zip of regisetered agent's addressn    date1 - begining date of date range
  for date of incorporation (format: MM-DD-YYYY)n    date2 - ending date of date range
  for date of incorporation (format: MM-DD-YYYY)n    start - number in the results
  set to begin the search. For example, if a query returns 1000 results, specifying
  a start of 80 would return results 80 through 99 in the list.n    format - \"json\"
  or \"xml\"n    callback - for json format, this value must be supplied for cross-site
  scripting access. Use \"?\" with jquery.nnExamples:nnJSONnnhttp://www.sos.wa.gov/corps/search_results.aspx?name_type=starts_with&name=Seattle+Sounders&format=jsonnnXMLnnhttp://www.sos.wa.gov/corps/search_results.aspx?name_type=starts_with&name=Seattle+Sounders&format=xmlnnCorporation
  DetailsnA new version has been released to address the multiple titles for a governing
  person. Please append \"&version=2\" to the query string to retrieve a node for
  each title (XML) or an array of strings (JSON).nnURL: http://www.sos.wa.gov/corps/search_detail.aspxnnQuery
  String Parameters:nn    ubi - UBI of the corporation/entityn    format - \"json\"
  or \"xml\"n    callback - for json format, this value must be supplied for cross-site
  scripting access. Use \"?\" with jquery.nnExamples:nnJSONnnhttp://www.sos.wa.gov/corps/search_detail.aspx?ubi=601810719&format=json&version=2&callback=?nnXMLnnhttp://www.sos.wa.gov/corps/search_detail.aspx?ubi=601810719&format=xml&version=2nnSupport
  and FeedbacknnWe are happy to answer general questions regarding the API. Due to
  limited resources we cannot offer specific help with the programming or the integration
  of the output into your application or system.  Please send questions and comments
  to matthew.edwards@sos.wa.gov .\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
